text:
@RealEric4Real @carlcicahn1 @StarLineChicago @mdasilva1563 @stevevance 1. The steam/diesel intercity trains ran on totally different tracks.

2. No, having two termini in Loop doesn't count as through-running.

The goals of through-running are a. reduce transfers b. reduce dwell time c. reduce need for central yards.  None of that applied to IC.

@carlcicahn1 @akgerber @A320Lga CDOT minimum would be 8' (4' in each direction).

For comparison, the LFT is 12'.  I think the Dearborn lane in the Loop is 9'.

You could also just go with a contraflow (southbound) protected lane and traffic calming shared lane northbound.
